import React, {useEffect} from 'react';
import { useParams } from 'react-router-dom';
import axios from "axios";

function Post() {
    let {id} = useParams() ;

    useEffect(()=> {
        axios.get("http://localhost:8080/posts").then( (response) => {
            setListofPosts(response.data);
          });

    })
    return (
        <div>
            {id}
        </div>
    )
}

export default Post
